insert into "public"."applications" ("app_description", "app_id", "app_name", "categorie_id", "interface", "logo") values ('ZBrush is the industry standard digital sculpting software. The latest version features an updated Anchors Brush system which provides an intuitive way to deform meshes by applying anchors onto a mesh while allowing for actions to be performed. The Knife Brushes gain increased design dexterity with a Split to Parts feature set allowing parts to be cut off and retained.', 36, 'ZBrush', 4, 'interface_zbrush.jpg', 'logo_zbrush.png');
insert into "public"."applications" ("app_description", "app_id", "app_name", "categorie_id", "interface", "logo") values ('Adobe Illustrator is a professional vector-based design and drawing program.  Used as part of a larger design workflow, Illustrator allows for the creation of everything from single design elements to entire compositions. Designers use Illustrator to create posters, symbols, logos, patterns, icons, etc.', 38, 'Illustrator', 2, 'interface_illustrator.png', 'logo_illustrator.png');
insert into "public"."applications" ("app_description", "app_id", "app_name", "categorie_id", "interface", "logo") values ('Visual Studio Code (VS Code) is a lightweight yet powerful source code editor developed by Microsoft. It provides an intuitive user interface.', 1, 'Visual Studio Code', 1, 'interface_visual_studio_code.png', 'logo_visual_studio_code.png');
insert into "public"."applications" ("app_description", "app_id", "app_name", "categorie_id", "interface", "logo") values ('Photoshop is an image creation, graphic design and photo editing software developed by Adobe. The software provides many image editing features for pixel-based images, raster graphics and vector graphics.', 22, 'Photoshop', 2, 'interface_photoshop.jpg', 'logo_Photoshop.png');
insert into "public"."applications" ("app_description", "app_id", "app_name", "categorie_id", "interface", "logo") values ('Blender is the free and open source 3D creation suite. It supports the entirety of the 3D pipeline—modeling, rigging, animation, simulation, rendering, compositing and motion tracking, even video editing and game creation.', 27, 'Blender', 4, 'interface_blender.jpg', 'logo_blender.png');
insert into "public"."applications" ("app_description", "app_id", "app_name", "categorie_id", "interface", "logo") values ('IntelliJ IDEA is an Integrated Development Environment (IDE) for Java and Kotlin designed to maximize developer productivity. It does the routine and repetitive tasks for you by providing clever code completion, static code analysis, and refactorings, and lets you focus on the bright side of software development, making it not only productive but also an enjoyable experience.', 28, 'IntelliJ IDEA', 1, 'interface_intellij_idea.png', 'logo_intellij_idea.png');
insert into "public"."applications" ("app_description", "app_id", "app_name", "categorie_id", "interface", "logo") values ('Premiere Pro is the industry-leading video editing software for film, TV and the web. Creative tools and integration with other apps and services helps you craft footage into polished films and videos.', 29, 'Premier Pro', 3, 'interface_premier_pro.jpg', 'logo_premier_pro.png');
insert into "public"."applications" ("app_description", "app_id", "app_name", "categorie_id", "interface", "logo") values ('After Effects is the industry-standard software application for creating visual effects and motion graphics and can be purchased on its own or as part of the Adobe Creative Cloud.', 30, 'After Effects', 3, 'interface_after_effects.png', 'logo_after_effects.png');
insert into "public"."applications" ("app_description", "app_id", "app_name", "categorie_id", "interface", "logo") values ('FL Studio is one of the best DAWs for music production. FL Studio offers a selection of instruments, effects and plugins to allow you to help bring your musical ideas into fruition. These can be applied to numerous channels, which could also play home to audio tracks within a timeline.', 31, 'Fl Studio', 5, 'interface_fl_studio.jpg', 'logo_fl_studio.png');
insert into "public"."applications" ("app_description", "app_id", "app_name", "categorie_id", "interface", "logo") values ('Live is fast, fluid and flexible software for music creation and performance. It comes with effects, instruments, sounds and all kinds of creative features—everything you need to make any kind of music.', 32, 'Ableton Live', 5, 'interface_ableton_live.jpg', 'logo_ableton_live.png');
insert into "public"."applications" ("app_description", "app_id", "app_name", "categorie_id", "interface", "logo") values ('Autodesk Maya is a 3D computer graphics software used for creating interactive 3D animations, models, and simulations. It was first developed in the late 1980s and has since become one of the most widely used 3D software in the entertainment, architecture, and product design industries.', 35, 'Maya', 4, 'interface_maya.jpg', 'logo_maya.png');
